defs.script:
window.setInterval(function() {
var now     = new Date();
var hours   = now.getHours();
var minutes = now.getMinutes();
var time    = Math.min(60000, 1.025 * (1000 * now.getSeconds() + now.getMilliseconds()));
var seconds = Math.floor(time / 1000);
var millis  = time % 1000;
rotate('hourHand',   hours * 30 + minutes * 0.5);
rotate('minuteHand', minutes * 6);
rotate('secondHand', 6 * seconds + 3 * (1 + Math.cos(Math.PI + Math.PI * (0.001 * millis))));
}, 50);

function rotate(id, angle) {
var element = document.getElementById(id);
if (element) {
element.setAttribute('transform', 'rotate(' + angle + ', 100, 100)');
if (element.getAttribute('visibility') == 'hidden') {
element.setAttribute('visibility', 'visible');
}
}
}

svg.script:
        //
        var scale = 1.0;
  var heartWidth = 647;
  var heartHeight = 647;
var countDown = true;
var heart = document.querySelector(".scaleHeartG");

function updateAnimation(highResTime) {



      var transform = "translate(" + (1 - scale) * (heartWidth / 2) + "px, " + (1 - scale) * (heartHeight / 2) + "px) scale(" + scale + "," + scale + ")";
      heart.style.transform = transform;

      var computedTransform= getComputedStyle(heart).getPropertyValue('transform');
      heart.setAttribute('transform', computedTransform);

      if (countDown) {
        scale -= 0.008;
        } else {
        scale += 0.008;
        }


      if (scale < 1.0)
        {
        countDown = false;
      }

      if (scale > 1.2)
        {
        countDown = true;
      }


    window.requestAnimationFrame(updateAnimation);
  }
window.requestAnimationFrame(updateAnimation);
